import './App.css';
//import Hello from './Hello';
import Header from './Component/Header/Header';
import Create_Note from './Component/Create_File/Create_Note';
import Footer from './Component/Footer/Footer';
import Note from './Component/Note/Note';

function App() {
  return (
    <div className="App">
          <Header />
          <Create_Note />
          <Footer />
          <Note />  
    </div>
  );
}

export default App;
